px_ushort PX_FontGBKtoUnicode(px_ushort gbkcode)
{
	if (gbkcode<128)
	{
		return gbkcode;
	}
	else if(gbkcode>=0x8181&&gbkcode<0xfefd)
	{
		return __px_gbk2unicode[gbkcode- 0x8181];
	}
	return 0;
}

px_dword PX_FontGBKRawtoUnicode(px_dword raw_code)
{
	return PX_FontGBKtoUnicode(raw_code);
}

px_dword PX_FontUTF8RawToUnicode(px_dword raw_code,px_dword *pcode)
{
	
	px_dword unicode = 0;
	px_byte* utf8;
	px_int len = 0, i;

	utf8 = (px_byte*)&raw_code;
	

	if ((utf8[0] & 0x80) == 0) {
		len = 1;
		unicode = utf8[0];
	}
	else if ((utf8[0] & 0xE0) == 0xC0) {
		len = 2;
		unicode = utf8[0] & 0x1F;
	}
	else if ((utf8[0] & 0xF0) == 0xE0) {
		len = 3;
		unicode = utf8[0] & 0x0F;
	}
	else if ((utf8[0] & 0xF8) == 0xF0) {
		len = 4;
		unicode = utf8[0] & 0x07;
	}
	else
	{
		return 0;
	}

	for (i = 1; i < len; i++)
	{
		unicode = (unicode << 6) | (utf8[i] & 0x3F);
	}
	if(pcode)
	*pcode = unicode;
	return len;
}

px_dword PX_FontGetUnicodeCode(PX_FontModule* module, px_dword rawcode)
{
	px_dword unicode=0;
	switch (module->codePage)
	{
	case PX_FONTMODULE_CODEPAGE_GBK:
		unicode = PX_FontGBKRawtoUnicode(rawcode);
		break;
	case PX_FONTMODULE_CODEPAGE_UTF8:
		PX_FontUTF8RawToUnicode(rawcode, &unicode);
		break;
	case PX_FONTMODULE_CODEPAGE_UTF16:
	case PX_FONTMODULE_CODEPAGE_UNICODE:
		unicode = rawcode;
		break;
	default:
		unicode = 0;
		break;
	}
	return unicode;
}

px_void PX_GetASCIICode(px_uchar* pBuffer,px_uchar ASCII)
{  
	if(ASCII-32<95)
	PX_memcpy(pBuffer,(px_void *)AsciiLib[(ASCII - 32)] ,16);
	else
	PX_memset(pBuffer,0xff,16);
}


px_int PX_FontDrawChar(px_surface *psurface, px_int x,px_int y,px_uchar ASCI,px_color Color )
{
	unsigned short i, j;
	px_uchar buffer[16], tmp_char;

	if (ASCI==' ')
	{
		return 0;
	}

	PX_GetASCIICode(buffer,ASCI); 

	for( i=0; i<16; i++ )
	{
		tmp_char = buffer[i];
		for( j=0; j<8; j++ )
		{
			if( (tmp_char >> (7 - j)) & 0x01 )
			{
				PX_SurfaceDrawPixel(psurface,x+j,y+i,Color);
			}
		}
	}
	return 16;
}

px_int PX_FontDrawText(px_surface *psurface,px_int x,px_int y,PX_ALIGN align,const px_char *Text,px_color Color)
{
	px_uchar TempChar;
	px_int resX=x;
	px_int xlen=0;
	px_int frWidth,frHeight;
	const px_char *CalcText=Text;
	
	PX_FontTextGetRenderWidthHeight(Text,&frWidth,&frHeight);

	switch (align)
	{
	case PX_ALIGN_LEFTTOP:
		break;
	case PX_ALIGN_MIDTOP:
		x-=frWidth/2;
		break;
	case PX_ALIGN_RIGHTTOP:
		x-=frWidth;
		break;
	case PX_ALIGN_LEFTMID:
		y-=frHeight/2;
		break;
	case PX_ALIGN_CENTER:
		y-=frHeight/2;
		x-=frWidth/2;
		break;
	case PX_ALIGN_RIGHTMID:
		y-=frHeight/2;
		x-=frWidth;
		break;
	case PX_ALIGN_LEFTBOTTOM:
		y-=frHeight;
		break;
	case PX_ALIGN_MIDBOTTOM:
		y-=frHeight;
		x-=frWidth/2;
		break;
	case PX_ALIGN_RIGHTBOTTOM:
		y-=frHeight;
		x-=frWidth;
		break;
	}


	while(*Text!=0)
	{
		if (*Text=='\r'||*Text=='\n')
		{
			y+=__PX_FONT_HEIGHT+4;
			x=resX;
			Text++;
			continue;
		}

		TempChar = *Text++;  
		PX_FontDrawChar(psurface, x, y, TempChar, Color);    
		x += __PX_FONT_ASCSIZE;  
		continue;
	}
	return x-resX+1;
}

PX_FontModule_Charactor* PX_FontModuleCreateTTFCharacter(PX_FontModule* mod,px_dword unicode_code)
{
	if (mod->ttfbuffer)
	{
		PX_ttfontinfo info;
		px_int ascent, descent, lineGap;
		px_int ax, lsb, c_x1, c_y1, c_x2, c_y2, y;
		px_float scale;
		PX_FontModule_Charactor* pcharactor;
		pcharactor = (PX_FontModule_Charactor*)MP_Malloc(mod->mp, sizeof(PX_FontModule_Charactor));
		if (!pcharactor)
		{
			return 0;
		}
		if (!PX_ttInitFont(mod->mp, &info, mod->ttfbuffer, 0))
		{
			return 0;
		}
		scale = PX_ttScaleForPixelHeight(&info, mod->max_Height * 1.0f);
		PX_ttGetFontVMetrics(&info, &ascent, &descent, &lineGap);
		ascent = (px_int)(ascent * scale);
		descent = (px_int)(descent * scale);
		PX_ttGetCodepointHMetrics(&info, unicode_code, &ax, &lsb);
		PX_ttGetCodepointBitmapBox(&info, unicode_code, scale, scale, &c_x1, &c_y1, &c_x2, &c_y2);
		y = ascent + c_y1;
		pcharactor->header.BearingX = 0;
		pcharactor->header.BearingY = -c_y1;
		if (c_y2>mod->max_Height-mod->max_BearingY)
		{
			mod->max_BearingY = mod->max_Height - c_y2;
		}

		if (!PX_ShapeCreate(mod->mp, &pcharactor->shape, c_x2 - c_x1, c_y2 - c_y1))
		{
			MP_Free(mod->mp, pcharactor);
			//out of memory
			return 0;
		}

		PX_ttMakeCodepointBitmap(&info, pcharactor->shape.alpha, c_x2 - c_x1, c_y2 - c_y1, c_x2 - c_x1, scale, scale, unicode_code);

		pcharactor->header.Font_Width = (px_int)(ax * scale);
		pcharactor->header.Font_Height = mod->max_Height;
		pcharactor->header.Advance = (px_int)(ax*scale+0.5f);
		if (PX_MapPut(&mod->characters_map, (px_byte*)&unicode_code, sizeof(unicode_code), pcharactor)!=PX_HASHMAP_RETURN_OK)
		{
			PX_ShapeFree(&pcharactor->shape);
			MP_Free(mod->mp, pcharactor);
		}
		return pcharactor;
	}
	return 0;
}

PX_FontModule_Charactor* PX_FontModuleSearchOrCreateTTFCharacter(PX_FontModule* mod, px_dword unicode_code)
{
	PX_FontModule_Charactor* pChar=(PX_FontModule_Charactor*)(PX_MapGet(&mod->characters_map, (px_byte*)&unicode_code, sizeof(unicode_code)));
	if (!pChar)
	{
		return PX_FontModuleCreateTTFCharacter(mod, unicode_code);
	}
	return pChar;
}

px_void PX_FontTextGetRenderWidthHeight(const px_char *Text,px_int *width,px_int *height)
{
	px_int x=0,y=0;
	px_int max_width=0,max_height=0;

	while(*Text!=0)
	{
		if (*Text=='\r'||*Text=='\n')
		{
			y+=__PX_FONT_HEIGHT+4;
			if (y>max_height)
			{
				max_height=y;
			}
			Text++;
			continue;
		}

		if((*Text)&0x80)
		{
			//not support
			Text++;
			continue;
		}

		if (*Text==' ')
		{
			Text++;
			x += __PX_FONT_ASCSIZE;
			if (x>max_width)
			{
				max_width=x;
			}
			continue;
		}

		Text++;    

		x += __PX_FONT_ASCSIZE;
		if (x>max_width)
		{
			max_width=x;
		}
		if (y+__PX_FONT_HEIGHT>max_height)
		{
			max_height=y+__PX_FONT_HEIGHT;
		}
	}
	if(width)
	*width=max_width;
	if(height)
	*height=max_height;
}

px_int PX_FontModuleGetCharacterRawCode(PX_FONTMODULE_CODEPAGE codePage,const px_char *Text,px_dword *code)
{
	const px_uchar *uText=(const px_uchar *)Text;
	switch(codePage)
	{
	case PX_FONTMODULE_CODEPAGE_GBK:
		if (*uText==0)
		{
			*code=0;
			return 0;
		}
		if ((*uText)&0x80)
		{
			*code=(px_dword)((*uText)+*(uText+1)*256);
			return 2;
		}
		else
		{
			*code=(px_dword)(*uText);
			return 1;
		}
		break;
	case PX_FONTMODULE_CODEPAGE_UTF8:
		{
			px_dword bc=1;
			px_dword rcode=0;
			px_uchar pageHead=(px_uchar)(*uText);
			px_uchar oftbit=0x80;
			if (pageHead==0)
			{
				return 0;
			}

			rcode=(*uText);
			while (1) 
			{
				if ((pageHead&oftbit)==0)
				{
					break;
				}
				
				oftbit>>=1;

				if ((pageHead&oftbit)==0)
				{
					break;
				}
				uText++;
				rcode+=((*uText)<<(bc*8));
				bc++;
			};
			*code=rcode;
			return bc;
		}
		break;
	case PX_FONTMODULE_CODEPAGE_UTF16:
		{
			*code=(px_dword)((*uText)+*(uText+1)*256);
			if (*code==0)
			{
				return 0;
			}
			return 2;
		}
		break;
	default:
		return 0;
		break;
	}
	*code=0;
	return 0;
}

px_bool PX_FontModuleInitialize(px_memorypool *mp,PX_FontModule *module)
{
	module->mp=mp;
	module->codePage=PX_FONTMODULE_CODEPAGE_UNDEFINED;
	module->max_BearingY=0;
	module->max_Height=0;
	module->max_Width=0;
	return PX_MapInitialize(mp,&module->characters_map);
}

px_void PX_FontModuleSetCodepage(PX_FontModule* module, PX_FONTMODULE_CODEPAGE codePage)
{
	module->codePage = codePage;
}

px_bool PX_FontModuleInitializeTTF(px_memorypool* mp, PX_FontModule* module, PX_FONTMODULE_CODEPAGE codepage, px_int fontsize, const px_byte* ttf_buffer, px_int ttf_size)
{
	if (module->characters_map.tree.size)
	{
		return PX_FALSE;
	}
	
	
	if (!PX_FontModuleInitialize(mp, module))return PX_FALSE;
	module->ttfbuffer = (px_byte*)MP_Malloc(mp, ttf_size);
	if (!module->ttfbuffer)
	{
		PX_FontModuleFree(module);
		return PX_FALSE;
	}
	module->ttfsize = ttf_size;
	PX_memcpy(module->ttfbuffer, ttf_buffer, ttf_size);
	module->max_Width = fontsize;
	module->max_Height = fontsize;
	module->codePage= codepage;
	module->max_BearingY = fontsize;
	return PX_TRUE;
}

px_bool PX_FontModuleLoad(PX_FontModule *module,px_byte *buffer,px_int size)
{
	px_int offset=0;
	PX_FontModule_Charactor *cpy;

	if(module->mp==PX_NULL)
	{
		PX_ASSERT();
		return PX_FALSE;
	}
	
	while (offset<size)
	{
		px_byte *pData;
		px_dword unicode;
		PX_FontModule_Charactor_Header *pcHeader=(PX_FontModule_Charactor_Header *)(buffer+offset);
		offset+=sizeof(PX_FontModule_Charactor_Header);
		pData=(buffer+offset);
		if(pcHeader->c_magic[0]!='P')  
			goto _ERROR;
		if(pcHeader->c_magic[1]!='X')  
			goto _ERROR;
		if(pcHeader->c_magic[2]!='F')  
			goto _ERROR;
		if(pcHeader->c_magic[3]!='M')  
			goto _ERROR;

		if (module->codePage==PX_FONTMODULE_CODEPAGE_UNDEFINED)
		{
			module->codePage=(PX_FONTMODULE_CODEPAGE)pcHeader->codePage;
		}
		else
		{
			if (pcHeader->codePage!=(px_dword)module->codePage)
			{
				offset+=pcHeader->Font_Width*pcHeader->Font_Height;
				continue;
			}
		}
	
		switch (pcHeader->codePage)
		{
		case PX_FONTMODULE_CODEPAGE_GBK:
			unicode = PX_FontGBKRawtoUnicode(pcHeader->charactor_code);
			break;
		case PX_FONTMODULE_CODEPAGE_UTF8:
			PX_FontUTF8RawToUnicode(pcHeader->charactor_code,&unicode);
			break;
		case PX_FONTMODULE_CODEPAGE_UTF16:
		case PX_FONTMODULE_CODEPAGE_UNICODE:
			unicode = pcHeader->charactor_code;
			break;
		default:
			unicode = 0;
			break;
		}
		if (!unicode)
		{
			offset += pcHeader->Font_Width * pcHeader->Font_Height;
			continue;
		}

		if (PX_MapGet(&module->characters_map, (px_byte*)&unicode, sizeof(unicode)))
		{
			offset+=pcHeader->Font_Width*pcHeader->Font_Height;
			continue;
		}
		if ((px_int)pcHeader->BearingY>module->max_BearingY)
		{
			module->max_BearingY=pcHeader->BearingY;
		}
		if ((px_int)pcHeader->Font_Height>module->max_Height)
		{
			module->max_Height=pcHeader->Font_Height;
		}

		if ((px_int)pcHeader->Font_Width>module->max_Width)
		{
			module->max_Width=pcHeader->Font_Width;

		}
		cpy=(PX_FontModule_Charactor *)MP_Malloc(module->mp,sizeof(PX_FontModule_Charactor));
		
		if (!cpy)
		{
			goto _ERROR;
		}
		
		PX_memcpy(cpy,pcHeader,sizeof(PX_FontModule_Charactor_Header));

		if(!PX_ShapeCreate(module->mp,&cpy->shape,cpy->header.Font_Width,cpy->header.Font_Height))
		{
			goto _ERROR;
		}
		PX_memcpy(cpy->shape.alpha,pData,cpy->header.Font_Width*cpy->header.Font_Height);
		offset+=cpy->header.Font_Width*cpy->header.Font_Height;
		

		PX_MapPut(&module->characters_map,(px_byte *)&unicode,sizeof(unicode),cpy);
	}
	return PX_TRUE;
_ERROR:
	//PX_FontModuleFree(module);
	return PX_FALSE;
}

px_void PX_FontModuleFree(PX_FontModule *module)
{
	PX_RBNode* pme;
	pme = PX_MapFirst(&module->characters_map);
	while (pme)
	{
		PX_FontModule_Charactor* pmc = (PX_FontModule_Charactor*)pme->_ptr;
		PX_ShapeFree(&pmc->shape);
		MP_Free(module->mp, pmc);
		pme->_ptr =PX_NULL;
		pme = PX_MapNext(pme);
	}
	PX_MapFree(&module->characters_map);
	if (module->ttfbuffer)
	{
		MP_Free(module->mp, module->ttfbuffer);
	}
}

px_int PX_FontModuleGetOneCharacterDesc(PX_FontModule *module,const px_char *Text,px_dword *punicode_code,px_int *advance,px_int *height)
{
	px_int f_size;
	PX_FontModule_Charactor *pChar=PX_NULL;
	px_dword raw_code, unicode_code;
	if(!(f_size=PX_FontModuleGetCharacterRawCode(module->codePage,Text, &raw_code)))
	{
		return 0;
	}

	if (!(unicode_code=PX_FontGetUnicodeCode(module, raw_code)))
	{
		return 0;
	}

	if (unicode_code ==' ')
	{
		*advance=module->max_Width/2;
		*height=module->max_Height;
		*punicode_code=unicode_code;
		return f_size;
	}

	pChar= PX_FontModuleSearchOrCreateTTFCharacter(module, unicode_code);
	if (pChar)
	{
		*advance=(px_int)pChar->header.Advance;
		*height=(px_int)pChar->header.Font_Height;
	}
	else
	{
		*advance=0;
		*height=0;
	}
	*punicode_code = unicode_code;
	return f_size;
}

px_void PX_FontModuleTextGetRenderWidthHeight(PX_FontModule *module,const px_char *Text,px_int *width,px_int *height)
{
	px_int dx=0;
	px_int dy=0;
	px_int max_width=0,max_height=0;
	const px_char *pTextPointer=Text;

	if (module==PX_NULL)
	{
		PX_FontTextGetRenderWidthHeight(pTextPointer,width,height);
		return;
	}
	else
	{
		while (PX_TRUE)
		{
			px_dword unicode_code = 0;
			px_int f_size,advance,height;
			PX_FontModule_Charactor* pChar = PX_NULL;

			if (!(f_size = PX_FontModuleGetOneCharacterDesc(module, pTextPointer,&unicode_code, &advance, &height)))
			{
				break;
			}
			pTextPointer += f_size;

			if (unicode_code == ' ')
			{
				dx += module->max_Width / 2;
			}
			else if (unicode_code == '\n')
			{
				dx = 0;
				dy += module->max_Height;
			}
			else
			{
				dx += advance;
			}

			if (dx > max_width)
			{
				max_width = dx;
			}

			if ((px_int)(dy + height) > max_height)
			{
				max_height = dy + height;
			}
		}
		if(width)
		*width = max_width;
		if(height)
		*height = max_height;
	}
	
}

px_int PX_FontModuleDrawCharacter(px_surface *psurface,PX_FontModule *mod,px_int x,px_int y,const px_dword unicode_code,px_color Color)
{
	PX_FontModule_Charactor *pChar;
	pChar=(PX_FontModule_Charactor *)PX_MapGet(&mod->characters_map, (px_byte*)&unicode_code, sizeof(unicode_code));
	if (pChar)
	{
		PX_ShapeRender(psurface,&pChar->shape,x+pChar->header.BearingX,y+mod->max_BearingY-pChar->header.BearingY,PX_ALIGN_LEFTTOP,Color);
		return pChar->header.Advance;
	}
	return 0;
}

px_int PX_FontModuleDrawText(px_surface *psurface,PX_FontModule *mod,px_int x,px_int y,PX_ALIGN align,const px_char *Text,px_color Color)
{
	px_int dx,dy,content_width=0;
	px_int frWidth,frHeight;
	const px_char *pTextPointer=Text;

	if (!Text)
	{
		PX_ASSERT();
		return 0;
	}

	if (mod==PX_NULL)
	{
		return PX_FontDrawText(psurface,x,y,align,Text,Color);
	}

	if (mod->codePage==PX_FONTMODULE_CODEPAGE_UNDEFINED)
	{
		return 0;
	}

	PX_FontModuleTextGetRenderWidthHeight(mod,Text,&frWidth,&frHeight);
	
	switch (align)
	{
	case PX_ALIGN_LEFTTOP:
		break;
	case PX_ALIGN_MIDTOP:
		x-=frWidth/2;
		break;
	case PX_ALIGN_RIGHTTOP:
		x-=frWidth;
		break;
	case PX_ALIGN_LEFTMID:
		y-=frHeight/2;
		break;
	case PX_ALIGN_CENTER:
		y-=frHeight/2;
		x-=frWidth/2;
		break;
	case PX_ALIGN_RIGHTMID:
		y-=frHeight/2;
		x-=frWidth;
		break;
	case PX_ALIGN_LEFTBOTTOM:
		y-=frHeight;
		break;
	case PX_ALIGN_MIDBOTTOM:
		y-=frHeight;
		x-=frWidth/2;
		break;
	case PX_ALIGN_RIGHTBOTTOM:
		y-=frHeight;
		x-=frWidth;
		break;
	}

	dx=x;
	dy=y;
	pTextPointer=Text;

	while (PX_TRUE)
	{
		px_dword unicode_code=0;
		px_int f_size,advance,height;
		if(!(f_size= PX_FontModuleGetOneCharacterDesc(mod,pTextPointer,&unicode_code,&advance,&height)))
		{
			break;
		}
	
		pTextPointer+=f_size;

		if (unicode_code ==' ')
		{
			dx+=mod->max_Width/2;
		}
		else if(unicode_code =='\n')
		{
			dy+=mod->max_Height;
			dx=x;
		}
		else
		{
			PX_FontModuleDrawCharacter(psurface, mod, dx, dy, unicode_code, Color);
			dx+=advance;
		}
	}
	return dx-x+1;
}

